import { Button, Select, MenuItem } from "@mui/material";
import { Box, Card, Checkbox, FormHelperText } from "@mui/material";
import FlexRowAlign from "components/flexbox/FlexRowAlign";
import AppTextField from "components/input-fields/AppTextField";
import { H1, Paragraph, Small } from "components/Typography";
import { useFormik } from "formik";
import useAuth from "hooks/useAuth";
import { useState } from "react";
import toast from "react-hot-toast";
import { Link, useNavigate } from "react-router-dom";
import * as Yup from "yup";

const Register = () => {
  const { register } = useAuth();
  const navigate = useNavigate();
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);

  const initialValues = {
    name: "",
    email: "",
    password: "",
    userType: "", 
    terms: true,
    submit: null
  };

  const validationSchema = Yup.object().shape({
    name: Yup.string().required("Name is required"),
    email: Yup.string().email("Must be a valid email").max(255).required("Email is required"),
    password: Yup.string().min(6, "Password should be of minimum 6 characters length").required("Password is required"),
    userType: Yup.string().required("User type is required")
  });

  const handleSubmit = async (values) => {
    setLoading(true);

    try {
      await register(values.email, values.password, values.name);
      setLoading(false);
      toast.success("You registered successfully");
      navigate("/dashboard");
    } catch (error) {
      setError(error?.message);
      setLoading(false);
    }
  };

  const formik = useFormik({
    initialValues,
    validationSchema,
    onSubmit: handleSubmit
  });

  return (
    <FlexRowAlign sx={{ flexDirection: "column", height: { sm: "100%" } }}>
      <Card sx={{ padding: 4, maxWidth: 600, boxShadow: 1 }}>
        <FlexRowAlign flexDirection="column" mb={5}>
          <Box width={38} mb={1}>
            <img src="/static/logo/SkinEdu.png" width="100%" alt="SkinEdu Logo" />
          </Box>
          <H1 fontSize={24} fontWeight={700}>
            Get started with SkinEdu
          </H1>
        </FlexRowAlign>

        <form noValidate onSubmit={formik.handleSubmit} style={{ width: "100%" }}>
          <AppTextField 
            fullWidth 
            name="name" 
            type="text" 
            label="Name" 
            onBlur={formik.handleBlur} 
            onChange={formik.handleChange} 
            value={formik.values.name} 
            error={formik.touched.name && Boolean(formik.errors.name)} 
            helperText={formik.touched.name && formik.errors.name} 
          />

          <AppTextField 
            fullWidth 
            name="email" 
            type="email" 
            label="Email" 
            onBlur={formik.handleBlur} 
            onChange={formik.handleChange} 
            value={formik.values.email} 
            error={formik.touched.email && Boolean(formik.errors.email)} 
            helperText={formik.touched.email && formik.errors.email} 
          />

          <AppTextField 
            fullWidth 
            name="password" 
            type="password" 
            label="Password" 
            onBlur={formik.handleBlur} 
            onChange={formik.handleChange} 
            value={formik.values.password} 
            error={formik.touched.password && Boolean(formik.errors.password)} 
            helperText={formik.touched.password && formik.errors.password} 
          />

          <Select
            fullWidth
            name="userType"
            value={formik.values.userType}
            onChange={formik.handleChange}
            onBlur={formik.handleBlur}
            error={formik.touched.userType && Boolean(formik.errors.userType)}
          >
            <MenuItem value="">Select User Type</MenuItem>
            <MenuItem value="Medicine Student">Medicine Student</MenuItem>
            <MenuItem value="Medicine Teacher">Medicine Teacher</MenuItem>
          </Select>
          {formik.touched.userType && formik.errors.userType && (
            <FormHelperText error>{formik.errors.userType}</FormHelperText>
          )}

          <FlexRowAlign mt={1} alignItems="center" gap={1}>
            <Checkbox disableRipple checked={formik.values.terms} onChange={formik.handleChange} name="terms" />
            <Paragraph fontWeight={600}>
              I agree to terms & conditions
            </Paragraph>
          </FlexRowAlign>

          {error && <FormHelperText error sx={{ mt: 2, fontSize: 13, fontWeight: 500, textAlign: "center" }}>
              {error}
            </FormHelperText>}

          <Box sx={{ mt: 4 }}>
            {loading ? 
              <Button disabled fullWidth variant="contained">
                Sign Up
              </Button> 
              : 
              <Button fullWidth type="submit" variant="contained">
                Sign Up
              </Button>}
          </Box>
        </form>

        <Paragraph marginLeft="auto" marginRight="auto" mt={2} color="text.disabled">
          Do you already have an account?{" "}
          <Link to="/login" style={{ display: "inline-block" }}>
            <Small color="primary.main">Login</Small>
          </Link>
        </Paragraph>
      </Card>
    </FlexRowAlign>
  );
};

export default Register;
